import {Button, Card} from "react-bootstrap";

class Projects extends React.Component {
  render() {
    return (
      <div>
        <div style={{marginTop: '20px', alignContent: 'center', alignT}} >
        <h1 style={{color: 'white', alignSelf: 'center'}}>Our Work</h1>
        </div>
        <Card>
            <Card.Body>
            <Button variant="solid" >Tester Solid</Button>
        <Button variant="outline">Tester Outline</Button>
        <Button variant="solid" size="xs">Tester small</Button>
            </Card.Body>
        </Card>
      </div>
    )
  }
}

export default Projects;
